caption.text:
*Unbezahlte Werbung, da Selbstgekauft*

Nabend, oder schon Gute Nacht 😄
Ich habe mir YouTubers Life für die Switch gekauft. Lange hab ich überlegt, ob ich es haben will. 
Für mich hat es sich auf jeden Fall gelohnt. Die erste Session ohne großer Pause war locker 6 Stunden. 😅😅
Mein Freund kam aus dem Kopfschütteln nicht mehr raus. 😂
Jedenfalls gefällt es mir sehr. Schon lange kein Simulationsspiel mehr zwischen den Fingern gehabt. Muss ich wieder öfter machen. 😁

